import React from 'react'
// import Index from './Index'

class Questions extends React.Component {

  getQuestions = () => {
    this.props.questions.map(question =>
      console.log(question)
    )
  }

  render() {
    console.log(this.props.questions)
    return (
      <div>
        Questions
        { this.props.questions.map(question => {
          <div>
            { question.text }
            <br /><br />
            <button>True</button>
            <button>False</button>
          </div>
        }) }
      </div>
    )
  }
}
export default Questions
